import React, {useRef} from "react";
import styles from './Main.module.scss'
import { Header } from "./Header/Header";
import { SecondBlock } from "./WelcomeToLearn/Block2";
import { Block3 } from "./WhyMarczypek/Block3";
import { Block4 } from "./AboutCourse/Block4";
import { Block5 } from "./CoursePlan/Block5";
import { Block6 } from "./PricingPlans/Block6";
import { Block7 } from "./Feedbacks";
import { Footer } from "./Footer/Footer";
const Context1 = React.createContext(null)
const Context2 = React.createContext(null)
const Context3 = React.createContext(null)
const Context4 = React.createContext(null)
const Context5 = React.createContext(null)
const Page = () => {
    const ref1 = useRef(null)
    const ref2 = useRef(null)
    const ref3 = useRef(null)
    const ref4 = useRef(null)
    const ref5 = useRef(null)

    return(
        <div className={styles.Main}>
            <div className={styles.Main__Header}>
                <Context1.Provider value={ref1}>
                    <Context2.Provider value={ref2}>
                        <Context3.Provider value={ref3}>
                            <Context4.Provider value={ref4}>
                                <Context5.Provider value={ref5}>
                                    <Header />
                                </Context5.Provider>
                            </Context4.Provider>
                        </Context3.Provider>
                    </Context2.Provider>
                </Context1.Provider>         
            </div>
            <div className={styles.Main__WelcomeToLearn}>
                <SecondBlock />
            </div>
            <div className={styles.Main__WhyMarczypek} ref={ref1}>
                <Block3 />
            </div>
            <div className={styles.Main__AboutCourse}>
                <Block4 />
            </div>
            <div className={styles.Main__CoursePlan} ref={ref2}>
                <Block5 />
            </div>
            <div className={styles.Main__PricingPlans} ref={ref3}>
                <Block6 />
            </div>
            <div className={styles.Main__FinalBlock}>
                <div className={styles.Main__FinalBlock__Feedbacks} ref={ref4}>
                    <Block7 />
                </div>
                <div className={styles.Main__FinalBlock__Footer} ref={ref5}>
                <Context1.Provider value={ref1}>
                    <Context2.Provider value={ref2}>
                        <Context3.Provider value={ref3}>
                            <Context4.Provider value={ref4}>
                                <Context5.Provider value={ref5}>
                                    <Footer/>
                                </Context5.Provider>
                            </Context4.Provider>
                        </Context3.Provider>
                    </Context2.Provider>
                </Context1.Provider>
                </div>
            </div>
        </div>
    )
}

export {Page}
